import { Link } from 'react-router-dom';
const Navbar = () => {
  return (
    <nav>
      <ul className='list-none text-1xl'>
        <li>
          <Link to='/'>KOM</Link>
        </li>
        <li>
          <Link to='/about'>About</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
